sand_insidesd.cleanup:
  path: '/admin/content/insidesd/cleanup'
  defaults:
    _title: 'InsideSD Cleanup'
    _controller: '\Drupal\sand_insidesd\Controller\SandInsidesdController'
  requirements:
    _permission: 'administer media'

sand_insidesd.form:
  path: '/admin/insidesd/form'
  defaults:
    _title: 'InsideSD Clean up Form'
    _form: 'Drupal\sand_insidesd\Form\SandInsideSDCleanupForm'
  requirements:
    _permission: 'administer media'
